import React, { Component } from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import { Row, Col, Card, Button, Icon, Progress } from "antd";
import Chart from 'react-apexcharts'
import ReactApexChart from 'react-apexcharts'
import ChartHistoryGroupColumn from "../components/charts/ChartHistoryGroupColumn";
import ChartBreakdownDonut from "../components/charts/ChartBreakdownDonut";





class Analytical extends React.Component{
  constructor(props) {
    super(props);

    this.state = {
      options: {
        chart: {
          id: ''
        },
        xaxis: {
          categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998]
        }
      },
         data: [{
        type: "bar",
        showInLegend: true,
        color: "#1df20a",
        legendText: "Actual",
        dataPoints: [

            { y: 3.2, label: "Net Profit/(Loss) …" },
                ]
			},

			{
		type: "bar",
		showInLegend: true,
         color: "blue",
         Text: "test",
         legendText: "Budget",
		dataPoints: [
			{ y:  5, label: "Net Profit/(Loss) …" },

		]
	},
			]
    }
  }
  render() {
    return (
      <ReactApexChart options={this.state.options} series={this.state.data} type="bar" width={500} height={320} />
    )
  }
}

export default Analytical;
